import styled from "styled-components";

export const ContainerHome = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

export const ContainerHeader = styled.div`
  height: 80px;
  width: 100%;
  z-index: 1;
`;
